import React from 'react';
import { AlertTriangle, RefreshCw, Home, FileText } from 'lucide-react';

class ErrorBoundary extends React.Component {
  constructor(props) {
    super(props);
    this.state = { hasError: false, error: null, errorInfo: null };
  }

  static getDerivedStateFromError(error) {
    return { hasError: true };
  }

  componentDidCatch(error, errorInfo) {
    this.setState({
      error: error,
      errorInfo: errorInfo
    });
    
    // Log error to console for debugging
    console.error('ErrorBoundary caught an error:', error, errorInfo);
    
    // Here you could also log the error to an error reporting service
    // Example: logErrorToService(error, errorInfo);
  }

  handleReload = () => {
    window.location.reload();
  };

  handleGoHome = () => {
    window.location.href = '/';
  };

  render() {
    if (this.state.hasError) {
      return (
        <div className="min-h-screen bg-gradient-to-br from-[#1A2A80] via-[#3B38A0] to-[#7A85C1] flex items-center justify-center p-4">
          <div className="max-w-md w-full">
            {/* Error Icon */}
            <div className="text-center mb-8">
              <div className="mx-auto w-20 h-20 bg-white/20 rounded-full flex items-center justify-center mb-4 backdrop-blur-sm">
                <AlertTriangle className="w-10 h-10 text-white" />
              </div>
              <h1 className="text-3xl font-bold text-white mb-2">Oops! Something went wrong</h1>
              <p className="text-white/80">
                We're sorry, but something unexpected happened. Don't worry, it's not your fault.
              </p>
            </div>

            {/* Error Details Card */}
            <div className="bg-white/10 backdrop-blur-md rounded-2xl p-6 border border-white/20 mb-6">
              <div className="space-y-4">
                <div>
                  <h3 className="text-white font-semibold mb-2">What happened?</h3>
                  <p className="text-white/80 text-sm">
                    The application encountered an unexpected error and couldn't continue running properly.
                  </p>
                </div>

                {/* Error message (only in development) */}
                {process.env.NODE_ENV === 'development' && this.state.error && (
                  <details className="mt-4">
                    <summary className="text-white/80 text-sm cursor-pointer hover:text-white">
                      Technical details (click to expand)
                    </summary>
                    <div className="mt-2 p-3 bg-black/20 rounded-lg text-xs text-white/70 font-mono overflow-auto max-h-40">
                      <div className="mb-2">
                        <strong>Error:</strong> {this.state.error && this.state.error.toString()}
                      </div>
                      {this.state.errorInfo.componentStack && (
                        <div>
                          <strong>Component Stack:</strong>
                          <pre className="whitespace-pre-wrap">{this.state.errorInfo.componentStack}</pre>
                        </div>
                      )}
                    </div>
                  </details>
                )}
              </div>
            </div>

            {/* Action Buttons */}
            <div className="space-y-3">
              <button
                onClick={this.handleReload}
                className="w-full flex items-center justify-center space-x-3 p-4 bg-white/20 hover:bg-white/30 text-white rounded-xl backdrop-blur-sm transition-all duration-200 border border-white/20"
              >
                <RefreshCw className="w-5 h-5" />
                <span className="font-medium">Reload Page</span>
              </button>

              <button
                onClick={this.handleGoHome}
                className="w-full flex items-center justify-center space-x-3 p-4 bg-white/10 hover:bg-white/20 text-white rounded-xl backdrop-blur-sm transition-all duration-200 border border-white/20"
              >
                <Home className="w-5 h-5" />
                <span className="font-medium">Go to Home</span>
              </button>
            </div>

            {/* Help Text */}
            <div className="mt-8 text-center">
              <p className="text-white/60 text-sm mb-4">
                If the problem persists, try the following:
              </p>
              <div className="grid grid-cols-1 gap-3 text-left">
                <div className="flex items-start space-x-3 text-white/70 text-sm">
                  <div className="w-2 h-2 bg-white/40 rounded-full mt-2 flex-shrink-0"></div>
                  <span>Clear your browser cache and cookies</span>
                </div>
                <div className="flex items-start space-x-3 text-white/70 text-sm">
                  <div className="w-2 h-2 bg-white/40 rounded-full mt-2 flex-shrink-0"></div>
                  <span>Try using a different browser or incognito mode</span>
                </div>
                <div className="flex items-start space-x-3 text-white/70 text-sm">
                  <div className="w-2 h-2 bg-white/40 rounded-full mt-2 flex-shrink-0"></div>
                  <span>Check your internet connection</span>
                </div>
              </div>
            </div>

            {/* Footer */}
            <div className="mt-8 text-center">
              <div className="flex items-center justify-center space-x-2 text-white/50 text-sm">
                <FileText className="w-4 h-4" />
                <span>DocManager</span>
              </div>
            </div>
          </div>
        </div>
      );
    }

    return this.props.children;
  }
}

export default ErrorBoundary;
